criteria.textblock:
        Inclusion Criteria:

          1. Male subjects aged ≥ 18;

          2. Weigh at least 50 kg, and have a body mass index (BMI) ≥ 19 and ≤28 kg/m2;

          3. Subjects agree to use reliable contraceptive measures (e.g., abstinence,
             sterilization, contraceptives, injectable contraceptives methylprogesterone or
             subcutaneous implantation in the duration of the study and for 4 months after the
             study drug infusion);

          4. Sign the informed consent before the trial, and fully understand the content, process
             and possible adverse reactions of the trial. Must be able to communicate with the
             investigator, understand and comply with all study requirements.

        Exclusion Criteria:

          1. Those with a history of chronic liver, kidney, cardiovascular,
             neurological/psychiatric, digestive tract, respiratory, urinary, endocrine and other
             systemic diseases;

          2. Those with a history of autoimmune diseases;

          3. Regular drinkers in the 6 months prior to the trial had an average daily alcohol
             intake of more than 15 g (equivalent to 145 mL of wine, 450 mL of beer, or 43 mL of
             liquor with 40% alcohol content);

          4. Those who are suspected or confirmed to be allergic or have had serious drug or food
             allergic reactions in the past, have a clear history of allergies and/or are allergic
             to the research drug or its ingredients;

          5. Have used any drug (including Chinese medicine and vitamins) within 2 weeks before
             screening, or the last dose is less than 5 half-lives of the drug from the test
             administration date, whichever is longer;

          6. Have used of anti-PD-1/PD-L1 drugs;

          7. Those who have participated in other interventional clinical trials within 3 months
             before screening;

          8. ≥400 ml of blood loss, blood donation or receiving any blood product transfusion
             within 3 months before screening;

          9. Those who have undergone major surgery or hospitalized for illness within 3 months
             before screening;

         10. Those who have received live vaccines within 6 months prior to screening, or who are
             expected to receive live vaccines during the study period;

         11. Those with a history of drug abuse or positive drug screening results within 12 months
             prior to screening;

         12. Those who have abnormalities in vital signs, physical examination, and laboratory
             tests during the screening period and are judged to be clinically significant by the
             study physician (Note: If there is an abnormality and the study doctor judges that it
             has clinical significance, if it is within the normal range after re-examination, it
             can also be enrolled);

         13. There are abnormalities in the ECG during the screening period (such as QTcF≥ 450ms,
             shortened or prolonged PR interval, second-degree and third-degree atrioventricular
             block, pre-excitation syndrome, etc.) and are judged by the study doctor to have
             clinical significance;

         14. Chest x-ray (positive and lateral position) or lung CT during the screening period is
             abnormal and judged by the study doctor to be clinically significant;

         15. History of needle sickness and blood sickness; or those with poor vascular conditions,
             unable to retain implanted needles or unable to tolerate venipuncture blood
             collection;

         16. Those that the investigator believes are not suitable to participate in this clinical
             trial for other reasons.
